  </h1>
  <div className="heading_style">
   <SlotM x='😄' y='😄' z='😄' />
  <br/>
   <SlotM x='👍' y=' 👎 '  z=' 👍 ' />
   <br/>
   <SlotM  x=' 🌲 '  y=' 🌴 '  z=' 🌳 ' />
   <br/>
   <SlotM  x=' 🥭 ' y=' 🥭 ' z=' 🥭 ' />

   </div>
 </>
 );
};

export default App;
